import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";
import { useNavigate } from 'react-router-dom';
import MainRate from './table';
import './App.css';
import Conv from './cal'


const NotFound = () => {
  return <h2>404 Not Found</h2>;
}

const App = () => {
  const navigate = useNavigate();
  return (
    <Router>
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <Link className="navbar-brand" to="/">Currency Converter</Link>
        <button onClick={() => navigate('/cal')}></button>
      </nav>
      <Switch>
        <Route path="/" exact component={MainRate} />
        <Route path="/" exact component={Conv} />
      </Switch>
      <footer>
        <p>By Ravicha, Guided by Altcademy</p>
      </footer>
    </Router>
  );
}

export default App;
